import logo from './logo.svg';
import './App.css';
import './pages/dashboard.css';
import LBM from "./components/left_bar_menu"
import TBM from "./components/top_bar_menu"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <LBM />
      <TBM />
    </div>
  );
}

export default App;
